import React from "react";
import { Link } from "react-router-dom";
import { makeStyles, withStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

import logo from "../React/titlelog.png";
import "./SignUp.scss";
import Login from './Login'

const Zahidfield = withStyles({
  root: {
    "& label": {
      color: "#747573",
    },
    width: "100%",
    marginBottom: "15px",

    "& label.Mui-focused": {
      color: "white",
      borderColor: "white",
    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "white",
    },
    "& .MuiOutlinedInput-root": {
      "& fieldset": {
        borderColor: "black",
      },
      "&:hover fieldset": {
        borderColor: "#f16219",
      },
      "&.Mui-focused fieldset": {
        borderColor: "#f16219",
      },
    },
  },
})(TextField);

const SignUp = () => {
  return (
    <>
      <div className="main_container">
        <div className="centrel_div">
          <div className="img">
            <img className="logo_img" src={logo} alt="Error" />
          </div>
          <div className="heading">
            <h4 className="heading_title">Entre Your Details</h4>
          </div>
          <div className="inputs">
            <Zahidfield
              variant="outlined"
              id="custom-css-standard-input"
              label="Full Name"
            />
            <Zahidfield
              variant="outlined"
              id="custom-css-standard-input"
              label="Email"
            />
            <Zahidfield
              variant="outlined"
              id="custom-css-standard-input"
              label="Password"
            />
            <Zahidfield
              variant="outlined"
              id="custom-css-standard-input"
              label="Confirm Password"
            />

            <div className="button">
              <button className="submit">SIGN UP</button>
            </div>
            <div className="confirm">
              <h4 className="confirm_head">Already have an account</h4>
              <Link to="/Login" className="confirm_link">LOG IN</Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignUp;
